;; gorilla-repl.fileformat = 1

;; **
;;; Boiler-plate code --- importing necessary things.
;; **

;; @@
(use 'nstools.ns)
(ns+ template
  (:like anglican-user.worksheet))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Let us define a simple query.
;; **

;; @@
(defquery template
  (let [x (sample (bernoulli 0.5))]
    (observe (normal x 1) 0.8)
    (predict x)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;template/template</span>","value":"#'template/template"}
;; <=

;; **
;;; Now, we lazily perform the inference.
;; **

;; @@
(def samples (doquery :lmh template nil))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;template/samples</span>","value":"#'template/samples"}
;; <=

;; **
;;; And retrieve predicts from the lazy sequence.
;; **

;; @@
(def xs (map #(get % 'x) (map get-predicts (take 1000 samples))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;template/xs</span>","value":"#'template/xs"}
;; <=

;; **
;;; We can compute basic statistics, say the mean.
;;; 
;; **

;; @@
(double (/ (reduce + xs) (count xs)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-double'>0.56</span>","value":"0.56"}
;; <=

;; **
;;; And even visualize the pdf!
;; **

;; @@
(plot/list-plot (sort xs) :joined true)
